import React from "react";


const Todo =({data, deletee}) =>{
	
	
	
	return(
		data.map((da)=>{
		return(
			<div onClick={()=>deletee(da.id)} >
			<h1>{da.content}</h1>
			
		</div>
			
		)
		
		}))
	
}
export default Todo
